-- ----------------------------
-- Function structure for getDeptUp
-- ----------------------------
DROP FUNCTION IF EXISTS `getDeptUp`;
delimiter ;;
CREATE FUNCTION `getDeptUp`(rid VARCHAR(50))
 RETURNS varchar(1000) CHARSET utf8
BEGIN 
 DECLARE sTemp VARCHAR(1000); 
 DECLARE sTempChd VARCHAR(1000); 

 SET sTemp = '$'; 
 SET sTempChd =cast(rid as CHAR); 

 WHILE sTempChd is not null DO 
   SET sTemp = concat(sTemp,',',sTempChd); 
   SELECT group_concat(parent_id) INTO sTempChd FROM sys_dept where FIND_IN_SET(dept_id,sTempChd)>0; 
 END WHILE; 
 RETURN sTemp; 
 END
;;
delimiter ;

